import React, { useRef } from 'react';
import { Box, Container, Grid, Button, Input, Heading, Text } from 'theme-ui';

import Image from 'components/image';

import emailjs from '@emailjs/browser';

import img1 from 'assets/partner-1-1.png';
import img2 from 'assets/partner-1-2.png';
import img3 from 'assets/partner-1-3.png';


import bannerImg from 'assets/banner-image-1-1.png';

const Banner = () => {
  const form = useRef();

  const sendEmail = (e) => { 
    e.preventDefault();

    emailjs.sendForm('service_vppy4ad', 'template_tmbanoi', form.current, 'NT01CCJjMmnOvyhhc')
      .then((result) => {
          console.log(result.text);
      }, (error) => {
          console.log(error.text);
      });
  };


  return (
    <Box sx={styles.banner} id="banner">
      <Container sx={styles.container}>
        <Grid sx={styles.grid}>
          <Box sx={styles.content}>
            <Heading as="h3">
              Quickstart your IaC stack ðŸš€
            </Heading>
            <Text as="p">
              We help build and manage Infrastructure-as-Code implemenations to enable your organization
            </Text>
            <Box as="form" sx={styles.form}>
              <Box as="label" htmlFor="subscribe" variant="styles.srOnly">
                subscribe
              </Box>
              {/* <form ref={form} onSubmit={sendEmail}>
                <label>Name</label>
                <input type="text" name="user_name" />
                <label>Email</label>
                <input type="email" name="user_email" />
                <label>Message</label>
                <textarea name="message" />
                <input type="submit" value="Send" />
              </form> */}

              <form ref={form} onSubmit={sendEmail}>
                <Input
                    name="user_name"
                    id="email"
                    type="text"
                    placeholder="Schedule an Intro Meeting"
                    sx={styles.form.input}
                />
                <br/>
                <Input
                  name="user_email"
                  id="email"
                  type="text"
                  placeholder="Schedule an Intro Meeting"
                  sx={styles.form.input}
                />
                <br/>
                <Button type="submit" value="Send" sx={styles.form.button}>
                  Book Now
                </Button>
              </form>

            </Box>
            <Box sx={styles.partner}>
              <Text as="span">Sponsored by:</Text>
              <Box as="div">
                <Image src={img1} alt="" />
              </Box>
              <Box as="div">
                <Image src={img2} alt="" />
              </Box>
              <Box as="div">
                <Image src={img3} alt="" />
              </Box>
            </Box>
          </Box>
          <Box sx={styles.image}>
            <Image src={bannerImg} alt="" />
          </Box>
        </Grid>
      </Container>
    </Box>
  );
};

export default Banner;

